import React from 'react';
import './buttons.css';

function NumberButton({ onClick }) {
  const ids = ['7', '8', '9', '4', '5', '6', '1', '2', '3', '0', '.', '/'];

  return (
    <div className="numberdiv">
      {ids.map(id => (
        <div className="triplediv" key={id}>
          <button id={id} onClick={() => onClick(id)}>{id}</button>
        </div>
      ))}
    </div>
  );
}

export default NumberButton;
